export const GET_NAME_REGISTER = "GET_NAME_REGISTER";
export const GET_AGE_REGISTER = "GET_AGE_REGISTER";
export const GET_EMAIL_REGISTER = "GET_EMAIL_REGISTER";
// export const GET_CUSTOMER_REGISTERED = "GET_CUSTOMER_REGISTERED";

export const getNameRegister = (get_Name_Register) => ({ type: GET_NAME_REGISTER, get_Name_Register });
export const getAgeRegister = (get_Age_Register) => ({ type: GET_AGE_REGISTER, get_Age_Register });
export const getEmailRegister = (get_Email_Register) => ({ type: GET_EMAIL_REGISTER, get_Email_Register });
// export const getCusmoerRegistered = ({get_Name_Register, get_Age_Register, get_Email_Register}) => ({ type: GET_CUSTOMER_REGISTERED, get_Name_Register, get_Age_Register, get_Email_Register});
